import React from 'react'
import './feed.css'

import { Profile_cont } from '../../../components'
import { NoPictureLogo, Profile } from '../../../assets'


const Profile__story = ({ image , username }) => {
    return (
        <>
            <div className="feed__story-profile">
                <Profile_cont image={ image }/>
                <div className="username">{ username }</div>
            </div>
        </>
    )
}


const Feed = () => {

const numStory = 6;
const story = [];

for (let i=0; i<numStory; i++)  
{
    story.push(<Profile__story image={ NoPictureLogo } username="manishmh"/>);
}
    return (
        <div className="feed">
            <div className="feed__story">
                <Profile__story image={NoPictureLogo} username="manishmh"/>
            </div>
        </div>
    )
}

export default Feed
